import React from 'react';

const Item = ({ name, age }: { name: string, age: string }) => {
  return (
    <li>
      name: { name } / age: { age }
    </li>
  )
}

const TestMocking: React.FC = () => {
  return <div></div>;
};

export default TestMocking;
